import React from 'react';
import { Route, Routes } from 'react-router-dom';
import './App.css';
import {HomePage} from './pages/HomePage'
import {Navigation} from "./components/Navigation"
function App() {
  return (
    <>
    <Navigation/>
    <Routes>
      <Route path="/" element={<HomePage/>}/>
    </Routes>
    </>
  );
}

export default App;
